var title_f42_42_43692="ESA Adult dosing guidelines";
var content_f42_42_43692=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F59470&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F59470&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Dosing guidelines for epoetin and darbepoetin in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Three times weekly dosing",
"       </td>",
"       <td class=\"subtitle1\">",
"        Weekly dosing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Epoetin Alfa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Starting dose (Adults):",
"       </td>",
"       <td>",
"        150 units/kg subcutaneously (SC) three times weekly",
"       </td>",
"       <td>",
"        40,000 units SC",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Reduce dose by 25 percent if:",
"       </td>",
"       <td colspan=\"2\">",
"        Hemoglobin reaches a level needed to avoid transfusion or increases &gt;1 g/dL in any two-week period.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Withhold dose if:",
"       </td>",
"       <td colspan=\"2\">",
"        Hemoglobin exceeds a level needed to avoid red blood cell (RBC) transfusion; restart at 25 percent below the previous dose when the hemoglobin approaches a level where transfusions may be required.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Increase dose:",
"       </td>",
"       <td>",
"        To 300 units/kg SC three times weekly, if response is not satisfactory (rise in hemoglobin &lt;1 g/dL after four weeks of therapy&nbsp;and remains below 10 g/dL) to achieve and maintain the lowest hemoglobin level sufficient to avoid the need for RBC transfusion.",
"       </td>",
"       <td>",
"        To 60,000 units SC weekly, if response is not satisfactory (rise in hemoglobin &lt;1 g/dL after four weeks of therapy and remains below 10 g/dL) to achieve and maintain the lowest hemoglobin level sufficient to avoid the need for RBC transfusion.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Discontinue if:",
"       </td>",
"       <td colspan=\"2\">",
"        After completion of chemotherapy course, or if after eight weeks of therapy there is no response as measured by hemoglobin levels or if transfusions are still required.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Weekly dosing",
"       </td>",
"       <td class=\"subtitle1\">",
"        Once every three weeks dosing",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"3\">",
"        Darbepoetin Alfa",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Starting dose (Adults):",
"       </td>",
"       <td>",
"        2.25 microgram/kg SC once weekly",
"       </td>",
"       <td>",
"        500 micrograms SC every three weeks",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Reduce dose by 40 percent if:",
"       </td>",
"       <td colspan=\"2\">",
"        Hemoglobin exceeds a level needed to avoid transfusion, or increases &gt;1 g/dL in any two-week period.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Withhold dose if:",
"       </td>",
"       <td colspan=\"2\">",
"        The hemoglobin exceeds a level needed to avoid RBC transfusion; restart at 40 percent below the previous dose when the hemoglobin approaches a level where transfusions may be required.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Increase dose:",
"       </td>",
"       <td>",
"        To 4.5 microgram/kg, if response is not satisfactory (no reduction in transfusion requirements or rise in hemoglobin by &lt;1 g/dL after six weeks of therapy in the absence of a RBC transfusion) to achieve and maintain the lowest hemoglobin level sufficient to avoid the need for RBC transfusion.",
"       </td>",
"       <td>",
"        N/A",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Discontinue if:",
"       </td>",
"       <td colspan=\"2\">",
"        After completion of chemotherapy course, or if after eight weeks of therapy there is no response as measured by hemoglobin levels or if transfusions are still required.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: US Food and Drug Administration.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
