var title_f42_42_43693="Regression of LV hypertrophy with antihypertensive therapy";
var content_f42_42_43693=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=NEPH%2F82558&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=NEPH%2F82558&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Regression of left ventricular hypertrophy with antihypertensive therapy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 407px; height: 287px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Effect of therapy with each of five antihypertensive drug classes on reduction in left ventricular mass in patients with hypertension. These data represent a meta-analysis of 80 trials of over 4100 patients. The decrease in left ventricular mass index, adjusted for the duration of therapy and diastolic pressure, was significantly higher with angiotensin II receptor blockers (13 percent), calcium channel blockers (11 percent), and angiotensin converting enzyme inhibitors (10 percent) compared to beta blockers (6 percent).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from Klingbeil AU, Schneider M, Martus P, et al. Am J Med 2003; 115:41.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
